import React, { Component } from "react";
import '../Static/css/style.css';

class QRCode extends Component {
   

    render() {
       
		return (
            <React.Fragment>
            <div>
                <h2 class="heading-secondary">
                    QR Code
                </h2>
            </div>
            </React.Fragment>
		);
	}
}

export default QRCode;
